frontend coding agent thinks you have a bug. is this true?  Backend Issue: Missing Synthesis Generation

  The AI Universe backend is not generating synthesis responses properly. The frontend expects a synthesis field in the response but is receiving null or no synthesis at all.

  Expected API Response Structure

  The backend should return this exact structure for the agent.second_opinion tool:

  interface SecondOpinionResponse {
    primary: {
      model: "claude-primary";
      response: string;
      tokens: number;
      cost: number;
      error?: boolean;
    };
    secondaryOpinions: Array<{
      model: "gemini" | "cerebras" | "perplexity" | "claude-secondary";
      response: string;
      tokens: number;
      cost: number;
      error?: boolean;
    }>;
    synthesis: {  // ← THIS IS MISSING/NULL
      model: "claude-synthesis";
      response: string;  // ← Combined analysis of all responses
      tokens: number;
      cost: number;
      error?: boolean;
    } | null;
    summary: {
      totalModels: number;
      totalTokens: number;
      totalCost: number;
      successfulResponses: number;
    };
    metadata: {
      userId: string;
      sessionId: string;
      timestamp: string;
      processingTime: number;
    };
  }

  Current Problem

  - ✅ primary response working (Claude response)
  - ✅ secondaryOpinions working (Gemini, Cerebras, Perplexity responses)
  - ❌ synthesis is null or missing (should contain synthesized opinion)

  Required Fix

  The backend should:

  1. Collect all successful responses from primary + secondary opinions
  2. Generate synthesis prompt like:
  Analyze and synthesize the following AI responses to the question: "{original_question}"

  Response 1 (Claude): {claude_response}
  Response 2 (Gemini): {gemini_response}  
  Response 3 (Cerebras): {cerebras_response}
  Response 4 (Perplexity): {perplexity_response}

  Provide a synthesized analysis that:
  - Highlights areas of agreement and disagreement
  - Identifies the most accurate and comprehensive points
  - Provides additional insights from combining perspectives
  - Presents a balanced, well-reasoned conclusion
  3. Call Claude synthesis API with the combined prompt
  4. Return synthesis object with the response, tokens, and cost

  Backend Endpoint

  - URL: https://ai-universe-backend-dev-114133832173.us-central1.run.app/mcp
  - Method: POST
  - JSON-RPC Format:
  {
    "jsonrpc": "2.0",
    "id": 1,
    "method": "tools/call",
    "params": {
      "name": "agent.second_opinion",
      "arguments": {
        "question": "compare gemini ai to chatgpt ai",
        "maxOpinions": 5
      }
    }
  }

  Test Case

  When user asks: "compare gemini ai to chatgpt ai"

  Expected: Frontend shows "🧠 AI Synthesis" with a combined analysis
  Current: Frontend shows "Synthesized Opinion (Unavailable)" with just Claude response

  Implementation Notes

  - Synthesis should only be generated if at least 2 responses are successful
  - If synthesis generation fails, set synthesis.error = true
  - Include synthesis tokens/cost in the totals
  - Synthesis should be substantively different from individual responses

  The frontend is already configured to display synthesis properly - it just needs the backend to generate and return it correctly.
